window.bookSummaryJSON = "<p><b>The End is nigh …</b></p> <p>The war with the Tahni has dragged on for over two years, taking its toll on the lives of all involved.</p> <p>On the Aphrodite colony, Marine turned cybernetic commando Ryan Hendrix is readying his civilian militia to make one final strike against the enemy, in what they know could be a suicide mission.</p> <p>Back in Commonwealth space, Travis Miller and his task force have finally been given clearance to take back the occupied colony system. But the Tahni have had a year to prepare their defenses, and the price in blood will be dear.</p> <p>And somewhere, across the stars, the Tahni general Tan Kin is guiding his own strike force on a long and circuitous route that will take them behind human lines for an attack no one expects … and no one is prepared for.</p> <p>It will mean the end of the war … and may mean the end of everything.</p>"; 
